import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} >
          <Route  index path="Home" element={<Home />} />
          <Route path="Contactus" element={<Contactus />} />

          {/* Employee .Net */}
          <Route path="ListEmployee" element={<ListEmp />} />
          <Route path="Employee/:id" element={<Employee />} />
          <Route path="Empedit/:id" element={<EmployeeEdit />} />
          <Route path="Empdel/:id" element={<EmployeeDel />} />
          <Route path="Empcreate/" element={<Employeeadd />} />

          {/* Product Java */}
          <Route path='ProductList' element={<ProductList />} />
          <Route path='Procreate' element={<Productadd />} />
          <Route path='Product/:proid' element={<Product />} />
          <Route path='Proedit/:proid' element={<Productedit />} />
          <Route path='Prodel/:proid' element={<ProductDel />} />

          {/* Person Node */}
          <Route path='PersonList' element={<PersonList />} />
          <Route path='Person/:_id' element={<Person />} />
          <Route path='Personedit/:_id' element={<Personedit />} />
          <Route path='Persondel/:_id' element={<Persondel />} />
          <Route path='Personcreate' element={<Personcreate />} />

          <Route path="*" element={<Nopage />} />
        </Route>
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
